def calculus(li):
    finList =[li[i:i+13] for i in range(len(li))]
    print(finList)
    fprod=1
    prod=1
    i=0

    while(i<len(finList)):
        for var in finList[i]:
            prod = prod*int(var)
        if(prod>fprod):
            fprod =prod
            prod=1
            #print(fprod)
            i=i+1
        else:
            fprod =fprod
            prod =1
            i=i+1
    return fprod






